import React from "react";
import "./product.css";

const Product = () => {
    return (
    <div className="productThumb">
        <div className="imgWrapper">
            <img src="https://www.pngwing.com/en/free-png-tqtin" alt="" className="w-100"/>
        </div>
        
       </div>
    )
};

export default Product;
